  render() {
    return (
      <Draggable parent="desktop">
          <div id="each-icon">
          <img id="icons-pic" src={folder} alt="imp"></img>
            <p id="icon-name">{this.props.title}</p>
          </div>

      </Draggable>
    )
  }
}


export default Symbols;
